import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import SubNav from "./Components/SubNav";
import Home from "./Components/Pages1/Home";
import Atention from "./Components/Pages1/Atention";
import Information from "./Components/Pages1/Information";
import Login from "./Components/Pages1/Login";
import Register from "./Components/Pages1/Register";
import Sell from "./Components/Pages1/Sell";
import Service from "./Components/Pages1/Teaming";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <SubNav />
      <Switch>
        <Route path="/Atention">
          <Atention />
        </Route>
        <Route path="/Information">
          <Information />
        </Route>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/Login">
          <Login />
        </Route>
        <Route path="/Service">
          <Service />
        </Route>
        <Route path="/Register">
          <Register />
        </Route>
        <Route path="/sell">
          <Sell />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
